import React, { useRef } from "react";
import styled from "styled-components";

const Wrapper = styled.div`
  width: 100%;
  margin-top: 50px;
`;

const PageTitle = styled.h3`
  font-size: 22px;
  font-weight: 700;
  margin-bottom: 40px;
`;

const Write = () => {
  return (
    <Wrapper>
      <PageTitle>Write</PageTitle>
    </Wrapper>
  );
};

export default Write;
